import React, { useEffect } from 'react'

function UseEffectHookB() {

    useEffect(()=>{
        console.log('useEffectHookB component');
        const myinterval=setInterval(()=>{ 
            console.log('I am a setInterval function');
        },1000)
        
        // component will unmount for Functional Component :)
        return()=>{ 
            clearInterval(myinterval)
            console.log('component unmounted & cleared the interval');
        }
    })

    return (
        <>
            <div>UseEffectHookB</div>

        </>
    )
}

export default UseEffectHookB
